import styled from "@emotion/styled";

const Break = styled.div`
  width: 475px;
  margin: 30px auto;
  box-shadow: 0 6px 9px rgba(50, 50, 93, 0.06), 0 2px 5px rgba(0, 0, 0, 0.08),
    inset 0 1px 0 #82ffd3;
  border-radius: 4px;
  background-color: #4ad4a3;
  position: relative;
`;

export default Break;
